  false,\n\t\"url\": null,\n\t\"notes\": \"Report summarizing nest success at Klettke
  Waterfowl Production Area predator exclosure on Kulm wetland Management District
  in 2005. In 2005, the Klettke predator exclosure was dragged a total of five times
  using two Polaris Rangers and a 200 ft. chain. The first drag was conducted on May
  5, and the last nest was checked on August 9. A total of 74 nests were discovered,
  similar to 2004 totals. Predator trapping began on March 29 and the traps were pulled
  on July 27 before the unit was to be hayed. Unfortunately, the gate to the exclosure
  was left open sometime in the previous winter by a late season hunter allowing open
  access to mammalian predators. High trap rates started the season and continued
  through June. High nest predation followed for most of the nesting season, tapering
  off by mid-June. The hen escapes located throughout the fence appeared to allow
  a few predators inside the fence. These may have to be addressed in the future,
  either by modifying the escapes to prevent intrusion, or by installing one-way conibear
  traps as attempted this year.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
